import "./movieList.css";
import MovieListItem from "../movie-list-item/MovieListItem";

const MovieList = ({ data }) => {
  return (
    <ul className="content movie-list">
      {data.map((item) => (
        <MovieListItem
          {...item}
          // name={item.name}
          // viewers={item.viewers}
          // favourite={item.favourite}
        />
      ))}
    </ul>
  );
};

export default MovieList;
